import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';

const ProfileForm = () => {
  const { user, updateProfile } = useAuth();
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    birthdate: user?.profile?.birthdate?.split('T')[0] || '',
    country: user?.profile?.country || '',
    gender: user?.profile?.gender || 'prefer-not-to-say',
    lifestyle: {
      smoker: user?.profile?.lifestyle?.smoker || false,
      drinker: user?.profile?.lifestyle?.drinker || false
    }
  });
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await updateProfile(formData);
      navigate('/dashboard');
    } catch (err) {
      setError(err.toString());
    }
  };

  return (
    <div className="max-w-md mx-auto mt-8 p-6 bg-white rounded-lg shadow-lg">
      <h2 className="text-2xl font-bold mb-6 text-gray-800">Profile Information</h2>
      {error && <div className="mb-4 text-red-500">{error}</div>}
      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="birthdate">
            Birthdate
          </label>
          <input
            type="date"
            id="birthdate"
            value={formData.birthdate}
            onChange={(e) => setFormData({ ...formData, birthdate: e.target.value })}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="country">
            Country
          </label>
          <input
            type="text"
            id="country"
            value={formData.country}
            onChange={(e) => setFormData({ ...formData, country: e.target.value })}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="gender">
            Gender
          </label>
          <select
            id="gender"
            value={formData.gender}
            onChange={(e) => setFormData({ ...formData, gender: e.target.value })}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
            <option value="prefer-not-to-say">Prefer not to say</option>
          </select>
        </div>
        <div className="mb-6">
          <label className="block text-gray-700 text-sm font-bold mb-2">Lifestyle</label>
          <div className="space-y-2">
            <label className="flex items-center">
              <input
                type="checkbox"
                checked={formData.lifestyle.smoker}
                onChange={(e) =>
                  setFormData({
                    ...formData,
                    lifestyle: { ...formData.lifestyle, smoker: e.target.checked }
                  })
                }
                className="mr-2"
              />
              Smoker
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                checked={formData.lifestyle.drinker}
                onChange={(e) =>
                  setFormData({
                    ...formData,
                    lifestyle: { ...formData.lifestyle, drinker: e.target.checked }
                  })
                }
                className="mr-2"
              />
              Regular Drinker
            </label>
          </div>
        </div>
        <button
          type="submit"
          className="w-full bg-blue-500 text-white py-2 px-4 rounded-lg hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
        >
          Save Profile
        </button>
      </form>
    </div>
  );
};

export default ProfileForm;
